import React, { useMemo } from "react";
import MEAL_ITEMS from "./MEAL_DATA";

const MealItems = () => {
  const mealItems = useMemo(() => {
    return MEAL_ITEMS;
  }, []);

  return (
    <section>
      {mealItems.map((item) => {
        return <div key={item.id}>{item.name}</div>;
      })}
    </section>
  );
};

export default MealItems;
